oxy_webhelp_navlinks = {"key_management_service-d23139e9947":{"topics":[{"title":"Adding Azure Key Vaults","shortdesc":"<p class=\"shortdesc\">Add an Azure Key Vault to manage encryption for Azure based archives or Rubrik Cloud         Vault. The key vault securely stores your encryption keys and controls access to sensitive         data.<\/p>","href":"saas\/adding_akv.html","attributes":{"data-id":"adding_akv"},"menu":{"hasChildren":false},"tocID":"adding_akv-d23139e9958","next":"adding_akv-d23139e9958"},{"title":"Adding KMIP servers","shortdesc":"<p class=\"shortdesc\">To manage your Key Encryption Key and self-encrypting drive passwords on a Rubrik         cluster using a KMIP-compliant external key manager, you must add the details of the KMIP         server in <span class=\"ph\">RSC<\/span>.<\/p>","href":"saas\/adding_kmip_server.html","attributes":{"data-id":"adding_kmip_server"},"menu":{"hasChildren":false},"tocID":"adding_kmip_server-d23139e9980","next":"adding_kmip_server-d23139e9980"},{"title":"Editing KMS","shortdesc":"<p class=\"shortdesc\">Edit the KMS credentials to update the client ID and client secret for an Azure Key         Vault to change or update the credentials.<\/p>","href":"saas\/editing_kms.html","attributes":{"data-id":"editing_kms"},"menu":{"hasChildren":false},"tocID":"editing_kms-d23139e10008","topics":[]},{"title":"Deleting KMS","shortdesc":"<p class=\"shortdesc\">Delete a KMS instance, Azure Key Vault or KMIP server, when it is no longer needed         and no particular KMS is currently encrypting any data locations.<\/p>","href":"saas\/deleting_kms.html","attributes":{"data-id":"deleting_kms"},"menu":{"hasChildren":false},"tocID":"deleting_kms-d23139e10019","topics":[]}]}};